import React from 'react';
import './styles/Global.css'
import './styles/pages/Landing.css'
import imgLogo from './img/logo.svg';


function App() {
  return (
      <div id='page-landing'>
        <div className='content-wrapper'>
           <img src={imgLogo} alt></img>
        </div>
      </div>
  );
}

export default App;
